import React from "react";
// Components
import ProgressCircle from '../ProgressCircle';

const Nav = () => {
    return (
        <nav>
            <div className="nav-container">
                <span className="logo">Do.</span>
                <ProgressCircle 
                    sqSize={100}
                    strokeWidth={7}
                />
            </div>
        </nav>
    );
};

export default Nav;
